import './ItemDate.css';

function ItemDate(props){
    let date=props.date;
    let month=props.month;
    let year=props.year;
    return(
        <div className='msg-Date'>
            <div>{date}</div>
            <div>{month}</div>
            <div>{year}</div>
        </div>
    );
}

export default ItemDate;
